import { v4 as uuidv4 } from "uuid";
import portfolio from "./portfolio.jpg";
import player from "./player.jpg";

const test =
  "https://source.unsplash.com/1600x900/?nature,photography,technology";

const projects = [
  {
    id: uuidv4(),
    name: "Talga Player",
    desc: "Tech: HTML5, CSS3, Javascript, React, Redux, Styled-Components.",
    img: test,
  },
  {
    id: uuidv4(),
    name: "Personal Portfolio",
    desc: "Tech: HTML5, CSS3, Javascript, React, Styled-Components.",
    img: portfolio,
  },
  {
    id: uuidv4(),
    name: "Talga Player",
    desc: "Tech: HTML5, CSS3, Javascript, React, Redux, Styled-Components.",
    img: test,
  },
  {
    id: uuidv4(),
    name: "Talga Player",
    desc: "Tech: HTML5, CSS3, Javascript, React, Redux, Styled-Components.",
    img: test,
  },
];

export default projects;
